import classNames from "classnames";
import { setCurrentPath } from "state/instructor/instructorSplice";
import { useAppDispatch } from "store/hooks";
import {
  Traffic,
  Students,
  Reviews,
  Overview,
  Engagement,
  Messages,
  Announcements,
  Assignments,
  Qa,
} from "portal/state/location/paths";
import logo from "static/images/brand/logo/cfwhite.svg";
import { useState } from "react";
import React from "react";
export const Sidebar = ({ sideOpen, perfOpen }) => {
  const [toggle, setToggle] = React.useState(false);
  const dispatch = useAppDispatch();
  const communcationNav = () => {
    return [
      { href: Qa, name: "Q&A" },
      { href: Messages, name: "Messages" },
      { href: Assignments, name: "Assignments" },
      { href: Announcements, name: "Announcements" },
    ].map((item) => {
      return (
        <li
          role="presentation"
          className="side-nav--subnav-button--3MQwM side-nav--active--2qr2l  active"
        >
          <a
            data-resource="q&a"
            href={item.href}
            onClick={(event) => {
              event.preventDefault();
              setToggle(!toggle);
              dispatch(
                setCurrentPath(event.currentTarget.getAttribute("href"))
              );
            }}
          >
            {item.name}
            {/* Q&amp;A{" "} */}
          </a>
        </li>
      );
    });
  };

  const performanceNav = () => {
    return [
      { href: Overview, name: "Overview" },
      { href: Students, name: "Students" },
      { href: Reviews, name: "Reviews" },
      { href: Engagement, name: "Course Engagement" },
      { href: Traffic, name: "Traffic & " },
    ].map((item) => {
      return (
        <li
          role="presentation"
          className="side-nav--subnav-button--3MQwM side-nav--active--2qr2l  active"
        >
          <a
            data-resource="q&a"
            href={item.href}
            onClick={(event) => {
              event.preventDefault();
              setToggle(!toggle);
              dispatch(
                setCurrentPath(event.currentTarget.getAttribute("href"))
              );
            }}
          >
            {item.name}
            {/* Q&amp;A{" "} */}
          </a>
        </li>
      );
    });
  };
  return (
    <div
      onMouseOver={() => setToggle(false)}
      className={classNames("side-nav--side-nav--3Arp5", {
        "side-nav--side-nav-open--1zqDo": sideOpen,
      })}
    >
      <div className="side-nav--side-nav-inner--1ndT2">
        <div
          className={classNames("side-nav--primary-menu--2GcVo", {
            "side-nav--no-expand--176de": toggle,
          })}
        >
          <div className="nav-container">
            <ul className="nav nav-pills nav-stacked">
              <li className="side-nav--logo-menu-item--3ODgF">
                <a href="/instructor">
                  <img alt="codefluent" width={91} height={34} src={logo} />
                </a>
              </li>
              <li className="side-nav--nav-button--1zEvP side-nav--active--2qr2l">
                <a
                  data-resource="courses"
                  href="/instructor/courses"
                  onClick={(event) => {
                    event.preventDefault();
                    setToggle(!toggle);
                    dispatch(
                      setCurrentPath(event.currentTarget.getAttribute("href"))
                    );
                  }}
                >
                  <svg
                    aria-hidden="true"
                    focusable="false"
                    className="udlite-icon udlite-icon-medium side-nav--icon--3_8ka"
                  >
                    <use xlinkHref="#icon-video">
                      <svg id="icon-video" viewBox="0 0 24 24">
                        <path d="M21 3H3c-1.11 0-2 .89-2 2v12a2 2 0 002 2h5v2h8v-2h5c1.1 0 1.99-.9 1.99-2L23 5a2 2 0 00-2-2zm0 14H3V5h18v12zm-5-6l-7 4V7l7 4z"></path>
                      </svg>
                    </use>
                  </svg>
                  <span className="side-nav--title--1Fgkc">Courses</span>
                </a>
              </li>
              <li className="side-nav--nav-button--1zEvP">
                <a
                  data-resource="communication"
                  href="/instructor/communication/qa/"
                  onClick={(event) => {
                    event.preventDefault();
                    setToggle(!toggle);
                    dispatch(
                      setCurrentPath(event.currentTarget.getAttribute("href"))
                    );
                  }}
                >
                  <svg
                    aria-hidden="true"
                    focusable="false"
                    className="udlite-icon udlite-icon-medium side-nav--icon--3_8ka"
                  >
                    <use xlinkHref="#icon-message">
                      <svg id="icon-message" viewBox="0 0 24 24">
                        <path d="M20 2a2 2 0 012 2v12a2 2 0 01-2 2H6l-4 4V4a2 2 0 012-2h16M4 4v13.17L5.17 16H20V4H4m2 3h12v2H6V7m0 4h9v2H6v-2z"></path>
                      </svg>
                    </use>
                  </svg>
                  <span className="side-nav--title--1Fgkc">Communication</span>
                </a>
              </li>
              <li className="side-nav--nav-button--1zEvP">
                <a
                  onClick={(event) => {
                    event.preventDefault();
                    setToggle(!toggle);
                    dispatch(
                      setCurrentPath(event.currentTarget.getAttribute("href"))
